import React, {useState, useEffect, useRef} from 'react';
import { Page, Link, Container, Field, Button, Grid, Icon, Ellipsis, Card, CardCarte, Tabs, Modal, Menu, QRCode, gtag } from '../../components';

import { jsPDF } from "jspdf";

import img from '../../assets/images/default.jpg'
import iconInfoPDF from '../../assets/images/pdf/info.png'
import iconCutPDF from '../../assets/images/pdf/cut.png'

const fontRegular = ''

const fontBold = ''

const Front = ({actived, setActived, slug, id, ...props}) => {

  const siteUrl = `${process.env.REACT_APP_SITE_URL}/${slug}`
  const siteUrlId = `${process.env.REACT_APP_SITE_URL}/qr/${id}`

  const pageRef = useRef()

  const [qrCodeBase64, setQrCodeBase64] = useState(false)
  useEffect(() => {
    const qrCodeCanvas = document.querySelector('canvas')
    setQrCodeBase64(qrCodeCanvas.toDataURL('image/jpg', 0.3))
  },[])

  useEffect(() => {
    if (!actived) {
      pageRef.current.alert({
        type:'error',
         message:<div>
         <Icon name="warning-circled" />
         <div>
           <b>Seu menu está desativado</b>
           <p className="mt-0 mb-1">Torne ele ativo para que seus clientes possam acessá-lo.</p>
           <a onClick={() => setActived(true)}>Ativar</a>
         </div>
         </div>,
        delay:0}
      )
    } else {
        pageRef.current.alert(null)
    }
  }, [actived])

  const siteLink = () => {
    return siteUrl.replace(/^https?\:\/\//i, "");
  }

  const downloadPdf = v => {
    let doc = new jsPDF();

    doc.addFileToVFS('TTNorms-Regular.ttf', fontRegular)
    doc.addFont('TTNorms-Regular.ttf', 'fontRegular', 'normal')

    doc.addFileToVFS('TTNorms-Bold.ttf', fontBold)
    doc.addFont('TTNorms-Bold.ttf', 'fontBold', 'normal')

    if (v === 'qrcode-large') {
      const textCenter = 42.5
      const cols = 3

      let offsetX = 0
      const factorX = 63

      let offsetY = 0
      const factorY = 88

      doc.addImage(iconCutPDF, "PNG", 7.5, 16, 12, 12)

      for (var i = 0; i < 9; i++) {
        offsetX = (i % cols)*factorX

        doc.setDrawColor(234,234,234);
        doc.roundedRect(offsetX+15, offsetY+12, 55, 82, 3, 3, 'S')

        // title
        doc.setTextColor(253,154,36);
        doc.setFontSize(12);

        doc.setFont('fontBold')
        doc.text(offsetX+textCenter, offsetY+22, 'Oi!', 'center');

        // text
        doc.setFont('fontRegular')
        doc.setTextColor(52,52,52);
        doc.setFontSize(9);
        var splitTitle = doc.splitTextToSize('Confira nosso menu virtual. Utilize a câmera do seu celular para ler o qr-code', 44);
        doc.text(offsetX+textCenter, offsetY+26, splitTitle, 'center');

        // qrcode image
        doc.addImage(qrCodeBase64, "PNG", offsetX+25, offsetY+38, 35, 35)

        //
        doc.text(offsetX+textCenter, offsetY+78, 'ou acesse:', 'center');

        //
        doc.setTextColor(253,154,36);
        var splitTitle = doc.splitTextToSize(siteLink(), 44);
        doc.text(offsetX+textCenter, offsetY+84, splitTitle, 'center');

        if(i % cols === cols-1) {
          offsetY = ((i+1)/cols)*factorY
          offsetX = 0
        }
      }

    } else if (v === 'qrcode') {
      const textLeft = 20.5
      const cols = 2

      let offsetX = 0
      const factorX = 97

      let offsetY = 0
      const factorY = 37

      doc.addImage(iconCutPDF, "PNG", 7.5, 18, 12, 12)

      for (var i = 0; i < 14; i++) {
        offsetX = (i % cols)*factorX

        doc.setDrawColor(243,243,243);
        doc.roundedRect(offsetX+16, offsetY+15, 82, 30, 3, 3, 'S')

        // title
        doc.setTextColor(253,154,36);
        doc.setFontSize(12);

        doc.setFont('fontBold')
        doc.text(offsetX+textLeft, offsetY+22, 'Oi!');

        // text
        doc.setFont('fontRegular')
        doc.setTextColor(199,199,199);
        doc.setFontSize(9);
        var splitTitle = doc.splitTextToSize('Confira nosso menu virtual. Utilize a câmera do seu celular para ler o qr-code ou acesse:', 44);
        doc.text(offsetX+textLeft, offsetY+26, splitTitle);

        // qrcode image
        doc.addImage(qrCodeBase64, "PNG", offsetX+70, offsetY+18, 24, 24)

        //
        doc.setTextColor(253,154,36);
        var splitTitle = doc.splitTextToSize(siteLink(), 44);
        doc.text(offsetX+textLeft, offsetY+38, splitTitle);

        if(i % cols === cols-1) {
          offsetY = ((i+1)/cols)*factorY
          offsetX = 0
        }
      }
    }

    // footer instructions
    doc.setTextColor(115,115,115);
    doc.text(21, 278, 'Dicas para melhor performance:');
    doc.setTextColor(199,199,199);
    doc.addImage(iconInfoPDF, "PNG", 15, 274.5, 5, 5)
    doc.text(21, 282, '- Recorte os cards com a informação de uso e qr-code;\r\n- Imprima em papel adesivo ou utilize fita adesiva para fixar\r\n- Deixe em algum lugar de alta visualização como mesa ou porta guardanapos.');

    doc.save(`${v}.pdf`);
  }

  const [modal, setModal] = useState()
  return (
    <Page ref={pageRef} className="CreateCarte">
      <main className="carte-main pb-6">
        <Container center>
          <Grid>
            <Grid.cell className="start-3_sm end-10_sm start-4_md end-9_md start-5_lg end-8_lg">
              <Card
                className="mt-3 mt-6 mt-8_lg card-page"
              >
                <div className={"flex-center" + (actived?'':' disabled')}>
                  <p className="mt-0 text-center">Faça o scan do qr-code com sua camera ou acesse o link para visualizar seu menu.</p>
                  <QRCode value={siteUrlId} />
                  <a onClick={() => gtag('qrcode-link-menu')} target="_blank" href={siteUrl?siteUrl:1} className="text-break-all size-3 text-center"><Icon name="link" />{siteLink()}</a><br/>
                  <Link gtag="qrcode-editar-link" to="/admin/profile"><Icon name="edit" /> Editar link</Link><br/>
                  <Button gtag="qrcode-imprimir" className="primary size-3" onClick={() => setModal('print')}><Icon className="mr-1" name="print" /> Imprimir</Button>
                  <Button  gtag="qrcode-baixar" className="primary size-3" href={qrCodeBase64?qrCodeBase64:''} target="_blank"  download="qrcode.png"><Icon className="mr-1" name="download" /> Baixar qr-code</Button>
                </div>
              </Card>
            </Grid.cell>
          </Grid>
        </Container>
      </main>


      <Menu menuHighlighter="qrcode" />

      <Modal show={modal}>

        <Modal.content
          show={modal==='print'}
          className="size-1"
          onClose={setModal}
          header={'Imprimir'}
        >
          <p className="text-center text-bold mt-0">Qual formato você deseja imprimir?</p>
          <Button gtag="" className="full" onClick={() => downloadPdf('qrcode-large')}><Icon name="qrcode" />Qr-code grande</Button>
          <Button className="full" onClick={() => downloadPdf('qrcode')}><Icon name="qrcode" />Qr-code pequeno</Button>
        </Modal.content>

      </Modal>
    </Page>
  );
}


export default Front;
